オールシーズン使えるレザー調のクラッチバッグ。ロールデザインが、シンプルながらもこなれ感をプラス。<br>【素材・サイズ感】<br>高級感あるフェイクレザーに、しっかりマチがあるデザインで収納力も○内と外にはZIPポケットが1つずつあるので携帯や定期いれなどの収納もしやすく機能性も。<br>【スタイリング】<br>シンプルで大人な印象で持てるので、合わせるCODEを選ばびません。スタイリングのポイント使いとして活躍してくれること間違いなし。<br>※開閉口…Zip<br>※ポケット…(外) 1 (内)1<br><hr>◆MODEL(166cm:ブラック着)<br>┗コーデITEM:トップス/アクセサリー/ベルト/ボトムス<br>※キャンセル/変更不可<br><br>【実寸(cm)約】<br>●高さ…19<br>●横幅…32<br>●マチ…7×32.5<br>●ポケット…(外) 1 (内) 1<br>●重さ…300g<br>【素材】<br>合成皮革<br>※【伸縮】なし/【淡色透け】なし/【濃色透け】なし /【裏地】あり<br><br><br><style type="text/css">
