メーカー希望小売価格はメーカーカタログに基づいて掲載しています<br>

<strong>日傘 折りたたみ</strong><br>
ワンランク上のUV対策アイテムブランド Solshade＜ソルシェード＞から日傘が登場。 <br>
デザインは甘過ぎず、大人の女性を意識したラインナップ。 <br>
大人ゆるカワ日傘の登場です。 <br>
UVケア必須アイテムだからこそ、機能はもちろん デザイン性も重視。『可愛いほうがHAPPY』 <br>
そんなこだわり派にピッタリなセレクションです。 
<br>
8本骨で構造されたデザインは、開くとカッチリ高級感。 <br>
軽量設計を重視し、素材にこだわりアルミ合金を親骨に使用。 <br>
傘を閉じる時に、爪を挟まない安全ストッパーを採用し、ネイルも傷まないご機嫌機能。 <br>
3段折りたたみ式で持運びにもとっても便利。 <br>
今年の焼かない夏にいかがでしょうか？<br><br>


