大人の女性のための日傘です。<br>
「美しく軽やかに」を主軸に実用的な紫外線カット、<br>
軽量化、晴雨兼用などを取り入れ、<br>
あなたのウーマンライフを応援します。<br>
ジャガード織×ビロードの風合<br>
厳選された高級素材で軽やかに。<br>
