<td class="sdtext">カテゴリトップ&nbsp;&gt;&nbsp;ファッション雑貨&nbsp;&gt;&nbsp;傘・日傘&nbsp;&gt;&nbsp;日傘

メーカー希望小売価格はメーカーカタログに基づいて掲載しています<br>
<strong>折りたたみ傘</strong><br>
<br>
ワンランク上のUV対策アイテムブランド Solshade(ソルシェード)から日傘が登場。 <br>
デザインは甘過ぎず、大人の女性を意識したラインナップ。 <br>
大人ゆるカワ日傘です。 <br>
紫外線を防いで、肌を守りましょう！ <br>
毎日使うUVケア必須アイテムだからこそ、機能はもちろん デザイン性も重視。『可愛いほうがHAPPY』 <br>
そんなこだわり派にピッタリなセレクションです。 <br>
軽さを重視し、素材にこだわりグラスファイバーを親骨に使用。 <br>
傘を閉じる時に、爪を挟まない安全ストッパーを採用し、ネイルも傷まないご機嫌機能。 <br>
3段折りたたみ式で持運びにもとっても便利。<br>
遮光率・UVカット率共に99%以上。<br>
撥水・耐風性能のあるかわいい晴雨兼用日傘。<br>
<br>
solshade001<br>
ブラックの生地に小さなドット柄がオシャレ。<br>
シルバーのフリルがアクセントになっています。<br>
高級感のある持ち手も特徴となっています。<br>
<br>
solshade002 ブラックフリル<br>
ピンクのフリルにさり気ないローズの透かしプリントがエレガントでおしゃれなデザイン。<br>
ミドル丈の傘袋にもフリル付で可愛く収納。<br>
<br>
solshade003 ブルードット<br>
日傘のフチに定番のドットとシンプルなダブルピコレースがかわいいデザイン。石突きがアクセント。<br>
傘袋はボタン付きで収納しやすく、持ち運びにも便利。<br>
